import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <label id='sex' >Sex</label>
      <label id='age' >Age</label>
      <label id='bmi' >BMI</label>
      <label id='weight' >weight</label>
      <label id='height' >Height</label>
      <label id='initialo2' >O2</label>
      <label id='initialhr' >Heart Rate</label>
      <label id='initialrr' >Respiratory Rate</label>
    </div>
  );
}

export default App;
